package br.com.restaurante.model;import java.util.List;@SuppressWarnings("serial")public class OrigemModel extends BaseModel implements CrudModel<OrigemModel>{	private String nome;	private String descricao;	private String codigo;	private String imagem;	private String nomeEmpresa;	private CidadeModel cidadeModel;	private String cnpj;	private String razaoSocial;	private String gmt;	private String endereco;	private List<OrigemModel> historico;	public OrigemModel() {	}		public OrigemModel(Long id) {		super();		this.id = id;	}	public OrigemModel(String codigo) {		super();		this.codigo = codigo;	}	public OrigemModel(Boolean flagAtivo) {		this.flagAtivo = flagAtivo;	}	public String getNome() {		return nome;	}	public void setNome(String nome) {		this.nome = nome;	}	public String getDescricao() {		return descricao;	}	public void setDescricao(String descricao) {		this.descricao = descricao;	}	public String getImagem() {		return imagem;	}	public void setImagem(String imagem) {		this.imagem = imagem;	}	public String getNomeEmpresa() {		return nomeEmpresa;	}	public void setNomeEmpresa(String nomeEmpresa) {		this.nomeEmpresa = nomeEmpresa;	}	public CidadeModel getCidadeModel() {		return cidadeModel;	}	public void setCidadeModel(CidadeModel cidadeModel) {		this.cidadeModel = cidadeModel;	}	public String getCnpj() {		return cnpj;	}	public void setCnpj(String cnpj) {		this.cnpj = cnpj;	}	public String getRazaoSocial() {		return razaoSocial;	}	public void setRazaoSocial(String razaoSocial) {		this.razaoSocial = razaoSocial;	}	public String getGmt() {		return gmt;	}	public void setGmt(String gmt) {		this.gmt = gmt;	}	public String getEndereco() {		return endereco;	}	public void setEndereco(String endereco) {		this.endereco = endereco;	}	public List<OrigemModel> getHistorico() {		return historico;	}	public void setHistorico(List<OrigemModel> historico) {		this.historico = historico;	}	public String getCodigo() {		return codigo;	}	public void setCodigo(String codigo) {		this.codigo = codigo;	}	@Override	public int hashCode() {		final int prime = 31;		int result = 1;		result = prime * result + ((codigo == null) ? 0 : codigo.hashCode());		return result;	}	@Override	public boolean equals(Object obj) {		if (this == obj)			return true;		if (getClass() != obj.getClass())			return false;		OrigemModel other = (OrigemModel) obj;		if (codigo == null) {			if (other.codigo != null)				return false;		} else if (!codigo.equals(other.codigo))			return false;		return true;	}}